import React from 'react';
import { View, Text } from 'react-native';
import { AntDesign } from '@expo/vector-icons';
import styled from 'styled-components/native';

const categoryElementWrap = styled(View)`
    flex-direction: row;
    align-items: center;
    justify-content: space-between;
    height : 13%;
`;

const categoryIconWrap = styled(View)`
    background-color: #ff9933;
    width : 20px;
    height : 20px;
    align-items: center;
    justify-content: center;
    border-radius: 17px;
    margin-right: 15px;
`;

const categoryText = styled(Text)`
    color : black;
    font-size : 10px;
    width: 78%;
    font-weight: bold;
`;

const LargeCatEle = (props) => {
    return (
        <categoryElementWrap key={props.key}>
            <categoryIconWrap>
                {props.icon}
            </categoryIconWrap>
            <categoryText>{props.category}</categoryText>
            <AntDesign name="right" size={15} color="black" />
        </categoryElementWrap>
    )
}

export default LargeCatEle;
